import React from 'react'

import FormInput from '../form-input/formInput.component'

import './sigIn.styles.scss'



class SignIn extends React.Component{
    constructor(props){
        super(props);

        this.state={
            email:'',
            password:''
        }
    }

    handleSubmit = e => {
        e.preventDefault();

        this.setState({
            email:'',
            password:''
        })
    }

    handleChange = e => {
        const { value, name } = e.target

        this.setState({
            [name]: value
        })
    }

    render(){
        return(
            <div className='sign-in'>

                <h2>I have an account</h2>
                <span>Sign in with your email and password</span>

                <form onSubmit={this.handleSubmit}>

                    <FormInput 
                    email='email' type='email' handleChange={this.handleChange} value={this.state.email} requiered  label='Email'/>


                    <FormInput email='password' type='password' handleChange={this.handleChange} value={this.state.password} requiered label='Password'/>


                    <input type='submit' value='Submit Form' />

                </form>

            </div>


        )
    }
}


export default SignIn
